import './Sidebar.css';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <h2>Menu</h2>
      <ul>
        <li><a href="#">Home</a></li>
        <li><a href="#">Training Data</a></li>
        <li><a href="#">Evaluation Data</a></li>
        <li><a href="#">About the Models</a></li>
        <li><a href="#">Data Usage and Privacy</a></li>
        <li><a href="#">Meet the Team</a></li>
      </ul>
    </div>
  );
};

export default Sidebar;
